  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Kodiak
  NWR outlines Refuge accomplishments during the 1975 fiscal year. The report begins
  by summarizing the habitat conditions, water conditions, and food and cover conditions
  during the year. Wildlife- including migratory birds, upland game birds, big game
  animals, furbearers, predators, rodents, mammals, raptors, and fish- is also covered.
  The Refuge development and maintenance section discusses physical developments.
  Resource management is outlined; topics include grazing. A progress report on field
  investigations and applied research is also provided. The public relations section
  of the report describes recreational uses and Refuge visitors.\",\n\t\"license_title\":
